import Question from "./Question";


function QuestionList({ questions, visibleQuestions }) {
  return (
    questions.map(
      ({
        question,
        answer01,
        answer02,
        answerScore01,
        answerScore02,
        qitemNo,
      }) => {
        return (
          <Question
            invisible={
              !visibleQuestions.find((visibleQuestion) => {
                return visibleQuestion.qitemNo === qitemNo;
              })
            }
            ref={register}
            qitemNo={qitemNo}
            question={question}
            answer01={answer01}
            answer02={answer02}
            answerScore01={answerScore01}
            answerScore02={answerScore02}
          />
        );
      }
    )
  );
}

export default QuestionList;
